local type_string_to_type <const> = { -- Does not support "any" type.
	cam = "__tointeger",
	entity = "__tointeger",
	player = "__tointeger",
	vehicle = "__tointeger",
	object = "__tointeger",
	ped = "__tointeger",
	pickup = "__tointeger",
	hash = "__tointeger",
	int = "__tointeger",
	bool = "__tointeger",
	["const char*"] = "__tostring",
	float = "__tonumber",
	vector3 = "__tov3",
	void = "void"
} -- Not all types have been added to this list. Add more as needed.

local function parse_type(native_result, Type)
	essentials.assert(type_string_to_type[Type], "Missing type in map.", Type)
	local result
	if type_string_to_type[Type] == "__tostring" then
		result = native_result[type_string_to_type[Type]](native_result, true)
	else
		result = type_string_to_type[Type] ~= "void" and native_result[type_string_to_type[Type]](native_result) or nil
	end
	if Type == "bool" then
		result = result ~= 0
	end
	return result
end

local function parse_parameters(pars, ...)
	local args <const> = {}
	local buffers <const> = {}
	local find <const> = string.find
	local select <const> = select
	local current_par = 1
	for par in pars:gmatch("([^,]+) ") do
		if find(par, "*", 1, true) and not find(par, "const", 1, true) then
			if find(par, "vector3", 1, true) then
				args[#args + 1] = native.ByteBuffer32()
				buffers[#buffers + 1] = {type = "v3", buffer = args[#args]}
			elseif find(par, "char", 1, true) then
				args[#args + 1] = native.ByteBuffer128() -- Might need 256 byte buffer for certain functions, but I reckon 128 bytes is enough most of the time.
				buffers[#buffers + 1] = {type = "string", buffer = args[#args]}
			elseif find(par, "float", 1, true) then
				args[#args + 1] = native.ByteBuffer8()
				buffers[#buffers + 1] = {type = "float", buffer = args[#args]}
			elseif find(par, "bool", 1, true) then
				args[#args + 1] = native.ByteBuffer8()
				buffers[#buffers + 1] = {type = "bool", buffer = args[#args]}
			else
				args[#args + 1] = native.ByteBuffer8()
				buffers[#buffers + 1] = {type = "integer", buffer = args[#args]}
			end
		else
			args[#args + 1] = select(current_par, ...)
		end
		current_par = current_par + 1
	end
	return args, buffers
end

do
-- Integrates all natives into the global space
-- Any functions that needs buffers to return values are implicitly converted into a regular lua function returning multiple values
-- It makes function calls 3x slower. 120k calls per second to 40k calls. (_get_entity_proofs)
-- If the function have an any* parameter, they're not converted.
-- If the api already have a function with the same name, it's not overwritten.
-- NATIVES ACCEPT V3, EVEN IF IT ASKS FOR X,Y,Z ARGS. IN SOME CASES, YOU MUST USE V3 FOR IT TO WORK. (set_entity_rotation__native)
	local _G_mt
	if getmetatable(_G) then
		_G_mt = getmetatable(_G)
		setmetatable(_G, nil)
	end

	for category_name, category in pairs(ids) do
		local mt
		if _G[category_name] then -- Checks if 2take1's api have a table with the name
			mt = getmetatable(_G[category_name])
			setmetatable(_G[category_name], nil)
		else
			_G[category_name] = {} -- Debugger raises error if messing with _G
		end
		for native_name, info in pairs(category) do
			_G[category_name][native_name] = _G[category_name][native_name] 
			or info.buffer_needed and not info.pars:find("any*", 1, true) and function(...)
				essentials.assert(menu.is_trusted_mode_enabled(1 << 2), "Tried to call a native without trusted mode enabled.", category_name, native_name)
				local args <const>, buffers <const> = parse_parameters(info.pars, ...)
				local return_value
				if info.type == "any" then
					return_value = native.call(info.id, table.unpack(args))
				else
					return_value = parse_type(native.call(info.id, table.unpack(args)), info.type)
				end

				for i = 1, #buffers do
					if buffers[i].type == "v3" then
						buffers[i] = buffers[i].buffer:__tov3()
					elseif buffers[i].type == "string" then
						buffers[i] = buffers[i].buffer:__string(true)
					elseif buffers[i].type == "float" then
						buffers[i] = buffers[i].buffer:__tonumber()
					elseif buffers[i].type == "bool" then
						buffers[i] = buffers[i].buffer:__tointeger() == 1
					else
						buffers[i] = buffers[i].buffer:__tointeger()
					end
				end
				if type_string_to_type[info.type] ~= "void" then
					return return_value, table.unpack(buffers)
				else
					return table.unpack(buffers)
				end
			end 
			or function(...)
				essentials.assert(menu.is_trusted_mode_enabled(1 << 2), "Tried to call a native without trusted mode enabled.", category_name, native_name)
				if info.type == "any" then
					return native.call(info.id, ...)
				else
					return parse_type(native.call(info.id, ...), info.type)
				end
			end
		end
		if mt then
			setmetatable(_G[category_name], mt)
		end
	end
	if _G_mt then
		setmetatable(_G, _G_mt)
	end
end

return natives -- WHEN UPDATING NATIVES, REMEMBER TO MANUALLY REPLACE __native NAMED FUNCTIONS